script: |
  super -f text -I q13794.spq | sort > q13794.out

inputs:
  - name: q13794.spq
    data: |
      SELECT col0 * col0 / col0 + + col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE NULL NOT IN ( col2 - - + 56 + - 57, + col1, + ( 56 ) / + + col2 / + ( - col0 ) ) AND NOT ( NULL NOT IN ( - col1, + col2 + + + col0 + + - col0 / - col2 ) );
  - name: tab2

outputs:
  - name: q13794.out
    data: |
